--
-- Name: f_asigna_municipio_name(); Type: FUNCTION; Schema: control; Owner: postgres
--

CREATE FUNCTION f_asigna_municipio_name() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
	NEW.municipio_name := 
		(SELECT control.cartodroid_municipios_sigpac.d_nombre
		FROM control.cartodroid_municipios_sigpac
		WHERE (control.cartodroid_municipios_sigpac.c_provincia = NEW."C_PROVINCIA"
			AND control.cartodroid_municipios_sigpac.c_municipio = NEW."C_MUNICIPIO"));
	RETURN NEW;
END;$$;


ALTER FUNCTION control.f_asigna_municipio_name() OWNER TO postgres;

--
-- Name: f_asigna_provincia_name(); Type: FUNCTION; Schema: control; Owner: postgres
--

CREATE FUNCTION f_asigna_provincia_name() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
	NEW.provincia_name := 
		(SELECT control.md_provincias.feature_na
		FROM control.md_provincias
		WHERE control.md_provincias.cod_ine = NEW."C_PROVINCIA");
	RETURN NEW;
END;$$;


ALTER FUNCTION control.f_asigna_provincia_name() OWNER TO postgres;

--
-- Name: f_asigna_sector_gf(); Type: FUNCTION; Schema: control; Owner: postgres
--

CREATE FUNCTION f_asigna_sector_gf() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
	IF
		(SELECT COUNT(*) FROM
			(SELECT t.id
			FROM control.md_sector_gf as t
			WHERE st_intersects(NEW.geom, t.geom)) 
		AS foo) > 0
	THEN 	
		NEW.sector_gf := (SELECT t.sector
			FROM control.md_sector_gf as t
			WHERE st_intersects(NEW.geom, t.geom) LIMIT 1);
		RETURN NEW;		
	ELSE
		RETURN NEW;
	END IF;
END;$$;


ALTER FUNCTION control.f_asigna_sector_gf() OWNER TO postgres;

