--
-- Name: f_asigna_zona_no_autorizada(); Type: FUNCTION; Schema: control; Owner: postgres
--

CREATE FUNCTION f_asigna_zona_no_autorizada() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
	IF
		(SELECT COUNT(*) FROM
			(SELECT t.id
			FROM control.md_zona_no_autorizada_2021 as t
			WHERE st_intersects(NEW.geom, t.geom)) 
		AS foo) > 0
	THEN 	
		NEW.zona_no_autorizada := 'Zona no autorizada';
		RETURN NEW;		
	ELSE
		IF
			(SELECT COUNT(*) FROM
				(SELECT t.id
				FROM control.md_zona_limitaciones_especificas_2021 as t
				WHERE st_intersects(NEW.geom, t.geom)) 
			AS foo) > 0
		THEN			
			NEW.zona_no_autorizada := 'Zona con limitaciones';
			RETURN NEW;
		ELSE
			NEW.zona_no_autorizada := 'No';
			RETURN NEW;
			
		END IF;
	END IF;
END;$$;


