--
-- Name: f_calc_distancia_derechos_preexistentes(); Type: FUNCTION; Schema: control; Owner: postgres
--

CREATE FUNCTION f_calc_distancia_derechos_preexistentes() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN 

	CREATE TEMPORARY TABLE temp_table (distances double precision) ON COMMIT DROP;
	
	INSERT INTO temp_table SELECT MIN(distance)FROM(
	SELECT ST_Distance(NEW.geom, md_regadios.geom) as distance
	FROM control.md_regadios As md_regadios  
	WHERE ST_DWithin(NEW.geom, md_regadios.geom, 10000)) AS foo;

	INSERT INTO temp_table SELECT MIN(distance)FROM(
	SELECT ST_Distance(NEW.geom, md_regadios_revision.geom) as distance
	FROM control.md_regadios_revision As md_regadios_revision  
	WHERE ST_DWithin(NEW.geom, md_regadios_revision.geom, 10000)) AS foo;

	INSERT INTO temp_table SELECT MIN(distance)FROM(
	SELECT ST_Distance(NEW.geom, md_regadios_sinclasificar.geom) as distance
	FROM control.md_regadios_sinclasificar As md_regadios_sinclasificar  
	WHERE ST_DWithin(NEW.geom, md_regadios_sinclasificar.geom, 10000)) AS foo;

	INSERT INTO temp_table SELECT MIN(distance)FROM(
	SELECT ST_Distance(NEW.geom, md_regadios_tramitacion.geom) as distance
	FROM control.md_regadios_tramitacion As md_regadios_tramitacion  
	WHERE ST_DWithin(NEW.geom, md_regadios_tramitacion.geom, 10000)) AS foo;

	INSERT INTO temp_table SELECT MIN(distance)FROM(
	SELECT ST_Distance(NEW.geom, md_uda_sup_2015_zr.geom) as distance
	FROM control.md_uda_sup_2015_zr As md_uda_sup_2015_zr  
	WHERE ST_DWithin(NEW.geom, md_uda_sup_2015_zr.geom, 10000)) AS foo;

	SELECT MIN(round(cast(distances as numeric),2))
	INTO NEW.distancia_derechos FROM temp_table;

	DROP TABLE temp_table;
	
	RETURN NEW;
END;$$;


ALTER FUNCTION control.f_calc_distancia_derechos_preexistentes() OWNER TO postgres;

