--
-- Name: 01A_CHD-TOP11-AREA; Type: VIEW; Schema: control; Owner: postgres
--

CREATE VIEW "01A_CHD-TOP11-AREA" AS
 SELECT casos.gid,
    casos.geom,
    casos."PK_UID",
    casos."L_SUP_SIGPAC",
    casos."C_PROVINCIA",
    casos."C_MUNICIPIO",
    casos."C_AGREGADO",
    casos."C_ZONA",
    casos."C_POLIGONO",
    casos."C_PARCELA",
    casos."C_RECINTO",
    casos."C_USO_SIGPAC",
    casos."C_COEF_REGADIO",
    casos."CAP_RESULTANTE",
    casos."REGION",
    casos."GRUPO_CULTIVO_2013",
    casos."C_REFREC",
    casos.id_recinto_rd,
    casos.area_caso,
    casos.id_cultivo_tipo,
    casos.id_cultivo_aspecto,
    casos.id_sistema_aplica,
    casos.fecha_actualiza_alberca,
    casos.producto_ot,
    casos.fecha_visita_gf,
    casos.notas_caso_recinto,
    casos.distancia_derechos,
    casos.num_caso,
    casos.anyo,
    casos.id_caso_tipo,
    casos.id_prioridad,
    casos.id_caso_estado,
    casos.fecha_matricula,
    casos.x_centroid,
    casos.y_centroid,
    casos.ndvi_umbral,
    casos.udaname_rp,
    casos.zona_no_autorizada,
    casos.sector_gf,
    casos.provincia_name,
    casos.municipio_name,
    casos.cod_criterio_seleccion
   FROM caso_recinto_2017_c casos
  WHERE ((casos.zona_no_autorizada)::text = 'Zona no autorizada'::text)
  ORDER BY casos.area_caso DESC
 LIMIT 7;


ALTER TABLE "01A_CHD-TOP11-AREA" OWNER TO postgres;

