    foo.id_cultivo_tipo,
    foo.id_cultivo_aspecto,
    foo.id_sistema_aplica,
    foo.fecha_actualiza_alberca,
    foo.producto_ot,
    foo.fecha_visita_gf,
    foo.notas_caso_recinto,
    foo.distancia_derechos,
    foo.num_caso,
    foo.anyo,
    foo.id_caso_tipo,
