   FROM caso_recinto_2017_c foo
  WHERE (((foo.municipio_name)::text, foo.area_caso) IN ( SELECT caso_recinto_2017_c.municipio_name,
            caso_recinto_2017_c.area_caso
           FROM caso_recinto_2017_c
          WHERE ((caso_recinto_2017_c.municipio_name)::text = (foo.municipio_name)::text)
          ORDER BY caso_recinto_2017_c.municipio_name, caso_recinto_2017_c.area_caso DESC
         LIMIT 2))
  ORDER BY foo.provincia_name, foo.municipio_name, foo.area_caso DESC;


